###############
#   Rules     #
###############
[0001 - Rule 1]
event_type=event
#precheck=""
regexp="(?P<date>(?:\d+/\d+/\d+)?\s\S+\s\w{2})\s*(?P<hostname>\S+)\s*(?P<severity>\S+)\s*\S+:\s*(?P<date2>\S+),\s*\[(?P<rule_id>[^]]*)],\s*\d+,\s*\S+\s*(?P<mac>\S+)\s*\|\s*FID\s(?P<fid>\d+),\s*\S+\s*(?P<system_name>\S+),\s*(?P<msg>(?:Port\s(?P<eth_port>\d+)\s)?(?P<precheck>Security violation: Login failure attempt|The last device change happened at|Zoning transaction initiated by|Switch status change contributing factor|Switch status changed|port fault\.|SNMP configuration attribute,|port fault\.)\s(?:via\s(?P<protocol>\S+)\.\sIP\sAddr:\s|User:\s(?P<username>\S+),\sRole:\s(?P<role>.*)\.|from (?P<from>\S+)\sto\s(?P<to>\S+)|Please change the SFP or check cable|:\s(?P<last_change>.*)|Faulty\sports:\s(?P<fault_ports>[^\.]*)\.\s\(Port\(s\)\s(?P<which_ports>.*)\)|Access\sHost\s(?P<subnet>[^,]*),\shas changed from\s\[|(?:Access\s)?(?P<rw>[^,]*), has changed from)(?P<src_ip>\d+\.\d+\.\d+\.\d+)?(?:] to \[(?P<dst_ip>\d+\.\d+\.\d+\.\d+)])?.*)"
date={normalize_date($date)}
plugin_sid={translate($rule_id)}
device={resolv($hostname)}
src_ip={resolv($src_ip)}
dst_ip={resolv($dst_ip)}
username={$username}
protocol={normalize_protocol($protocol)}
userdata1={$mac}
userdata2={$role}
userdata3={$rw}
userdata4={$from}
userdata5={$to}
userdata6={$last_change}
userdata7={$fault_ports}
userdata8={$which_ports}
userdata9={$subnet}

###############
#   Generic   #
###############
[9999 - Catch all]
event_type=event
#precheck=""
regexp="(?P<date>(?:\d+/\d+/\d+)?\s\S+\s\w{2})\s*(?P<hostname>\S+)\s*(?P<severity>\S+)\s*\S+:\s*(?P<date2>\S+),\s*\[(?P<rule_id>[^]]*)],\s*\d+,\s*\S+\s*(?P<mac>\S+)\s*\|\s*FID\s(?P<fid>\d+),\s*\S+\s*(?P<system_name>\S+),\s*(?P<msg>.*)"
date={normalize_date($date2)}
plugin_sid=20000000
device={resolv($hostname)}
userdata1={$mac}
userdata2={$rule_id}
userdata3={$severity}
userdata4={$system_name}
userdata5={$msg}
